==Fijian==
===Verb===
{{head|fj|verb}}
# {{lb|fj|intransitive}} to [[creep]], to [[crawl]] {{gloss|used especially for insects and bugs}}
#: {{syn|fj|qasi}}
{{head|fj|verb|yaqa-va}}
# {{lb|fj|transitive}} to [[creep]] to, on or over
====Usage notes====
The verbs ''yaqa'' and ''yaqava'' should only be used for creatures with legs. For creatures with no legs such as worms, snakes and eels, one should use {{m|fj|dolo}}.
